import { Route, Switch } from "react-router-dom";
import LoginPage from "./pages/Login";
import CreateAccountPage from "./pages/CreateAccount";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <LoginPage />
        </Route>
        <Route path="/create-account">
          <CreateAccountPage />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
